import React from "react";
import { Card, Container } from "react-bootstrap";

const CardEjemplarResultado = (props) => {
  return (
    <Container className="d-flex justify-content-end">
      <Card className="">
        <Card.Body>
          <h6>{props.nombre}</h6>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default CardEjemplarResultado;
